import "../css/guidebar.css"


class Navigation extends Component {
    render() {
        return(
            <div className="guide-bar">
                {/*<Navbar className="navbar-style" variant ="dark">*/}
                {/*    <Navbar.Brand href="/">*/}
                {/*        <img */}
                {/*            alt="NHS logo"*/}
